import React, { useState } from "react";
import axios from "axios";

export const Main = () => {
  const [pelis, setPelis] = useState([]);

  axios
    .get("http://www.omdbapi.com/?apikey=20dac387&")
    .then((data) => data.data)
    .then((data) => setPelis({ pelis: data }));

  return (
    <>
      <h1>{pelis[0]}</h1>
    </>
  );
};
